Subscribe to trades stream

### Background

This service provides the a real time stream of trades from covered exchanges.

### Connecting

Using a websocket client of your choosing, establish a connection to this service at `wss://market-data-trades-ws.lukka.tech/v1/trades`. You will need to create a bearer token using credentials with permission to access this service and provide this as an HTTP parameter to the connection URL.

#### Token Expiration

The token provided for the initial connection to this service will expire after an extended amount of time. You will need to reauthorize with a fresh bearer token by sending an authentication message (see Reauthorize (Client) example message). This service will notify the client process of an impending token expiration (see Reauthorize (Server) example message).

### URL

`wss://market-data-trades-ws.lukka.tech/v1/trades?access_token={{bearerToken}}`

#### Query Parameters

| **Parameter** | **Value** | **Description** |
| --- | --- | --- |
| access_token | {{bearerToken}} | valid bearer token |

### Messages

###### Subscribe (Client)

``` json
{
  "action": "subscribe",
  "parameters": {
    "pairCodes": [
      "XBT-USD"
    ],
    "sourceIds": [
      4002
    ],
    "baseAssetCodes": [],
    "counterAssetCodes": []
  }
}

 ```

###### Unsubscribe (Client)

``` json
{
  "action": "unsubscribe",
  "parameters": {
    "pairCodes": [
      "XBT-USD"
    ],
    "sourceIds": [
      4002
    ],
    "baseAssetCodes": [],
    "counterAssetCodes": []
  }
}

 ```

###### Reauthorize (Client)

``` json
{
  "action": "authenticate",
  "parameters": {
    "token": "{{bearerToken}}"
  }
}

 ```

###### Trade Record (Server)

``` json
{
   "metadata":{
      "dataType":"TRADE"
   },
   "data":[
      {
         "tsNanos":1651788934633000000,
         "pairCode":"XBT-USD",
         "baseAssetCode":"XBT",
         "counterAssetCode":"USD",
         "entityCode":"CPRO",
         "price":36450.1,
         "size":0.000463,
         "side":"BUY"
      },
      {
         "tsNanos":1651788935309000000,
         "pairCode":"XBT-USD",
         "baseAssetCode":"XBT",
         "counterAssetCode":"USD",
         "entityCode":"CPRO",
         "price":36434.01,
         "size":0.00068343,
         "side":"BUY"
      }
   ]
}

 ```

###### Reauthorize (Server)

``` json
{
  "metadata": {
    "dataType": "AUTH"
  },
