Subscribe to quotes stream

### Background

Quotes represent the "inside" price levels of the limit order book for a product trading on an exchange. This service provides the latest updates to these price levels (changes in price or size) on an exchange and pair basis.

### Connecting

Using a websocket client of your choosing, establish a connection to this service at `wss://market-data-quotes-ws.lukka.tech/v1/quotes`. You will need to create a bearer token using credentials with permission to access this service and provide this as an HTTP parameter to the connection URL.

#### Token Expiration

The token provided for the initial connection to this service will expire after an extended amount of time. You will need to reauthorize with a fresh bearer token by sending an authentication message (see Reauthorize (Client) example message). This service will notify the client process of an impending token expiration (see Reauthorize (Server) example message).

#### Heartbeat

Users can leverage ping/pong protocol to verify connectivity

### URL

`wss://market-data-quotes-ws.lukka.tech/v1/quotes?access_token={{bearerToken}}`

#### Query Parameters

| **Parameter** | **Value** | **Description** |
| --- | --- | --- |
| access_token | {{bearerToken}} | valid bearer token |

### Messages

